const Instalaciones= ()=>{
    return (
        <div>
          <h2>Instalaciones</h2>
          <p>¡Descubre nuestras increíbles instalaciones!</p>
          
          {/* Embed de YouTube */}
          <div style={{ position: 'relative', width: '100%', paddingBottom: '56.25%' }}>
            <iframe
              title="Tour de Instalaciones"
              width="100%"
              height="100%"
              src="https://www.youtube.com/embed/TUw5qIWZgbo" // Enlace de YouTube
              frameBorder="0"
              allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture"
              allowFullScreen
              style={{ position: 'absolute', top: 0, left: 0 }}
            ></iframe>
          </div>
    
          <p>
            Aquí podríamos añadir una descripción detallada de las instalaciones del restaurante.
            Desde el comedor principal hasta la cocina, mostrando la experiencia y el ambiente único que ofrecemos.
          </p>
        </div>
      );
    };
export default Instalaciones
